import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom'; 
import { useParams } from 'react-router-dom';


function Plantdetails() {
  const [data, setData] = useState([]);
  const { id } = useParams();

  useEffect(() => {
    fetch('http://localhost:8081/plantdetails')
      .then(res => res.json())
      .then(data => setData(data))
      .catch(err => console.log(err));
  }, []);

  return (
    <div className="p-4">
      {data.map((plant, index) => (
        <div key={index} className="p-4 my-4 border border-gray-300 rounded-lg bg-gray-50">
          <Link to={`/additionaldetails/${plant.id}`} className="font-semibold text-2xl hover:underline">
            <span className='font-bold text-2xl'>Plant Name:</span> {plant.name}
          </Link>
          <p className="mt-2 text-lg">Scientific Name: {plant.scientific_name}</p>
        </div>
      ))}
    </div>
  );
}

export default Plantdetails;
